export default function Eduction(props){
    let education=props.content;
    return(
        <>
            {
                education.map((el,index)=>(
                    <div className="flex flex-wrap">
                        <div className="card bg-slate-100 p-3">
                            <p className="text-indigo-500 font-bold">{el.degree}</p>
                            <p className="font-bold">{el.institute}</p>
                            <p className="text-slate-500 font-bold">{el.duration}</p>
                        </div>
                        {index!=education.length-1&&<img src="https://findbestcourses.com/wp-content/uploads/2021/11/test.png" className="dropShadow w-1/6"></img>}
                    </div>
                ))
            }
        </>
    )
}
